package com.example.riderapp.model;import java.io.Serializable;import java.util.Date;public class RideActivity  implements Serializable{	private String ra_id;	private String title;	private String begin_date;	private String from_where;	private String to_where;	private int time_count;	private String leaderId;	private long location_X;	private long location_Y;	private int members_count;	public int getMembers_count() {		return members_count;	}	public void setMembers_count(int members_count) {		this.members_count = members_count;	}	public String getFrom_where() {		return from_where;	}	public void setFrom_where(String from_where) {		this.from_where = from_where;	}	public String getTo_where() {		return to_where;	}	public void setTo_where(String to_where) {		this.to_where = to_where;	}	public String getRa_id() {		return ra_id;	}	public void setRa_id(String ra_id) {		this.ra_id = ra_id;	}	public String getTitle() {		return title;	}	public void setTitle(String title) {		this.title = title;	}	public String getBegin_date() {		return begin_date;	}	public void setBegin_date(String begin_date) {		this.begin_date = begin_date;	}	public int getTime_count() {		return time_count;	}	public void setTime_count(int time_count) {		this.time_count = time_count;	}	public String getLeaderId() {		return leaderId;	}	public void setLeaderId(String leaderId) {		this.leaderId = leaderId;	}	public long getLocation_X() {		return location_X;	}	public void setLocation_X(long location_X) {		this.location_X = location_X;	}	public long getLocation_Y() {		return location_Y;	}	public void setLocation_Y(long location_Y) {		this.location_Y = location_Y;	}}